// src/music/playlists.js

import APT from './Rose_Ft_Bruno_Mars_-_APT.mp3';
import Nonsense from './Sabrina Carpenter  Nonsense Official Audio.mp3';
import Thatsnot from './Charlie Puth  Thats Not How This Works Lyrics ft Dan  Shay.mp3';

import aptpic from '../images/APT.jpg';
import nonsensepic from '../images/nonsense.jpg';
import thatsnotpic from '../images/charlieputh.png';

export const midnightMoodsPlaylist = [
  {
    title: "Redemption",
    artist: "Besomorph & Coopex",
    src: APT,
    cover: aptpic,
  },
  // Add more songs...
];

export const partyStartersPlaylist = [
  {
    title: "Nonsense",
    artist: "Sabrina",
    src: Nonsense,
    cover: nonsensepic,
  },
  // Add more songs...
];

export const relaxingTonesPlaylist = [
  {
    title: "Thats Not How Its Worked",
    artist: "Charlie Puth",
    src: Thatsnot,
    cover: thatsnotpic,
  },
  // Add more songs...
];

// Define other playlists similarly...
